import Axios from 'axios';

const url = 'http://localhost:8080/api';

export const GetAll = tableSelected => {
    Axios.post(`${url}/getAll`,{table:tableSelected}).then(
        res => {
            return res.data;
        }
    ).catch(
        err => {
            return err;
        }
    );
}

export const AddOne = (table,data) => {
    Axios.post(`${url}/addOne`).then(
        res => {
            console.log(res);
        }
    );
}
